import React from "react";
import { Box } from "@chakra-ui/core";

export default function Item({ id, name, price, date, category }) {
  return (
    <Box display="flex" alignItems="space-around">
      <p>date: {date}</p>
      <p>name: {name}</p>
      <p>category: {category}</p>
      <p>price: {price}</p>
      <Box borderBottom="1px solid gray" mx="5%" />
    </Box>
  );
}
